import "./App.css";

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<img src="icon_btoshi.png" className="App-logo" alt="logo" />
				<nav>
					<div className="nav-item">
						<a href="tokenomics" style={{ color: "black" }}>
							tokenomics
						</a>
					</div>
				</nav>
			</header>

			<div id="tokenomics">tokenomics</div>
		</div>
	);
}

export default App;
